import './App.css';
import {BrowserRouter, Route} from 'react-router-dom';
import Welcome from './screens/Welcome';
import Profile from './screens/Profile';

const App =()=>
<BrowserRouter>
    <Route path='/' component={Welcome} />
    <Route path='/profile' component={Profile} />
</BrowserRouter>;



export default App;
